import datetime
import logging
import pandas as pd

# Configure logging
logging.basicConfig(filename='system.log', level=logging.ERROR)

# Data storage for simplicity
submissions = []
fpds_data = []
historical_fabs_files = []

class Submission:
    def __init__(self, duns_number, status, created_by):
        self.duns_number = duns_number
        self.status = status
        self.created_by = created_by
        self.errors = []
        self.timestamp = datetime.datetime.now()

class SystemAdministrator:
    @staticmethod
    def delete_old_records(date):
        global submissions
        submissions = [s for s in submissions if s.timestamp > date]
        logging.info(f"Deleted records older than {date}")

class UI_Designer:
    @staticmethod
