class DatabaseAdministrator:
    @staticmethod
    def ensure_deletion_integrity():
        print("Deletion integrity ensured for marked records.")

class SubmissionManager:
    @staticmethod
    def add_fabs_submission(duns_number, created_by):
        if SubmissionReviewer.prevent_double_submission(duns_number):
            new_submission = Submission(duns_number, "pending", created_by)
            submissions.append(new_submission)
            print(f"Submission {duns_number} added.")

class User:
    @staticmethod
    def view_submission_errors(duns_number):
        for submission in submissions:
            if submission.duns_number == duns_number:
                print(f"Errors for {duns_number}: {submission.errors}")

