class DataSteward:
    @staticmethod
    def load_historical_fpds_data(file_path):
        historical_data = pd.read_csv(file_path)
        print("Historical FPDS data loaded.")

class TeamLead:
    @staticmethod
    def record_submission_creator(duns_number, creator):
        for submission in submissions:
            if submission.duns_number == duns_number:
                submission.created_by = creator
                print(f"Creator for submission {duns_number} recorded as {creator}")

class SubmissionReviewer:
    @staticmethod
    def prevent_double_submission(duns_number):
        return not any(s.duns_number == duns_number for s in submissions)

class SystemAnalyst:
    @staticmethod
    def derive_office_name(office_code):
        office_mapping = {
            "001": "Headquarters",
            "002": "Regional Office",
            "003": "Branch Office"
        }
        return office_mapping.get(office_code, "Unknown Office")

class DataValidator:
    @staticmethod
    def validate_duns_number(duns_number, action_type):
        if len(duns_number) == 9 and duns_number.isdigit():
            return True
        else:
            Developer.log_error(f"Invalid DUNS number: {duns_number} for action type {action_type}")
            return False

class DataEntryOperator:
    @staticmethod
    def submit_record(duns_number, created_by):
        if DataValidator.validate_duns_number(duns_number, "submit"):
            SubmissionManager.add_fabs_submission(duns_number, created_by)
